import React, { useMemo } from 'react';
import {
  Card,
  CardContent,
  CardActions,
  Typography,
  Chip,
  Box,
  IconButton,
  Tooltip,
  Divider
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import EditIcon from '@mui/icons-material/Edit';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import NotificationsActiveIcon from '@mui/icons-material/NotificationsActive';
import NotificationsOffIcon from '@mui/icons-material/NotificationsOff';
import { Alert } from '../../types/alert';
import { 
  getConditionText, 
  getParameterName, 
  getParameterUnit 
} from '../../utils/alertUtils';

interface AlertCardProps {
  alert: Alert;
  onDelete: () => void;
  onEdit?: () => void;
  onToggleStatus?: () => void;
}

const AlertCard: React.FC<AlertCardProps> = ({ 
  alert, 
  onDelete, 
  onEdit, 
  onToggleStatus 
}) => {
  const { 
    name, 
    parameter, 
    condition, 
    threshold, 
    location, 
    status
  } = alert;

  // Memoize location string to avoid recalculation on re-renders
  const locationString = useMemo(() => {
    if (alert.resolvedLocation) return alert.resolvedLocation;
    
    if (location.city) {
      return location.city;
    } else if (location.coordinates) {
      return `Lat: ${location.coordinates.lat.toFixed(2)}, Lon: ${location.coordinates.lon.toFixed(2)}`;
    }
    return 'No location specified';
  }, [alert.resolvedLocation, location]);

  // Determine the active status - handle both status field and isTriggered
  const isActive = status === 'active' || alert.isTriggered;

  return (
    <Card 
      sx={{ 
        height: '100%', 
        display: 'flex', 
        flexDirection: 'column',
        borderLeft: 6,
        borderLeftColor: isActive ? 'success.main' : 'grey.400'
      }}
      elevation={2}
    >
      <CardContent sx={{ flexGrow: 1 }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2, alignItems: 'flex-start' }}>
          <Typography variant="h6" component="div" sx={{ fontWeight: 'bold' }}>
            {name}
          </Typography>
          <Chip
            label={isActive ? 'Active' : 'Inactive'}
            color={isActive ? 'success' : 'default'}
            size="small"
          />
        </Box>

        <Divider sx={{ my: 1.5 }} />

        <Box sx={{ display: 'flex', alignItems: 'center', mt: 2 }}>
          <LocationOnIcon sx={{ mr: 1, color: 'primary.main' }} fontSize="small" />
          <Typography variant="body2" component="div">
            {locationString}
          </Typography>
        </Box>

        <Box sx={{ mt: 2 }}>
          <Typography variant="body1" sx={{ fontWeight: 'medium' }}>
            Alert Condition:
          </Typography>
          <Typography variant="body2" color="text.secondary">
            {getParameterName(parameter)} is {getConditionText(condition)} {threshold}{getParameterUnit(parameter)}
          </Typography>
        </Box>
      </CardContent>

      <CardActions sx={{ justifyContent: 'space-between', p: 2, pt: 0 }}>
        <Box>
          {onToggleStatus && (
            <Tooltip title={isActive ? 'Deactivate Alert' : 'Activate Alert'}>
              <IconButton 
                onClick={onToggleStatus} 
                color={isActive ? 'success' : 'default'}
                aria-label={isActive ? 'Deactivate Alert' : 'Activate Alert'}
              >
                {isActive ? <NotificationsActiveIcon /> : <NotificationsOffIcon />}
              </IconButton>
            </Tooltip>
          )}
          {onEdit && (
            <Tooltip title="Edit Alert">
              <IconButton 
                onClick={onEdit} 
                color="primary"
                aria-label="Edit Alert"
              >
                <EditIcon />
              </IconButton>
            </Tooltip>
          )}
        </Box>
        <Tooltip title="Delete Alert">
          <IconButton 
            onClick={onDelete} 
            color="error"
            aria-label="Delete Alert"
          >
            <DeleteIcon />
          </IconButton>
        </Tooltip>
      </CardActions>
    </Card>
  );
};

export default React.memo(AlertCard);
